description:
&quot;Who Do You Think You Are?&quot; is a genealogy series in which 13 well known Canadians set out to discover their family roots. The series combines the allure and appeal of celebrity with the intrigue of uncovering secret, tantalizing tales. Each half hour episode combines the intimacy of observational documentary, the revelation of a well told detective story, the fascination of biography and the excitement of big picture history. The individual journeys into family history reflect the sweep and drama of Canada&amp;#039;s past.

Celebrities whose family stories will be told include Randy Bachman, Don Cherry, Mary Walsh, Sonja Smits, Margot Kidder, General Lewis MacKenzie, Steven Page, Chantal Kreviazuk, Avi Lewis, Margaret Trudeau, Scott Thompson, Shaun Majumder and Measha Brueggergosman.

